-- | Mouse button is represented by left, right, middle or a number
--   from 0 to 7 (note the difference from the GLFW C library).
data MouseButton
  = ButtonLeft
  | ButtonRight
  | ButtonMiddle
  | ButtonNo Int
  deriving (Eq, Show)

instance Enum MouseButton where
  fromEnum ButtonLeft = 0
  fromEnum ButtonRight = 1
  fromEnum ButtonMiddle = 2
  fromEnum (ButtonNo i) | i < 0 = 0
  fromEnum (ButtonNo i) | i < _GLFW_MOUSE_BUTTON_LAST = i
  fromEnum _ = _GLFW_MOUSE_BUTTON_LAST
  toEnum 0 = ButtonLeft
  toEnum 1 = ButtonRight
  toEnum 2 = ButtonMiddle
  toEnum i = ButtonNo i

-- | Joystick is represent a number from 0 to 15 (note the difference from the
--   GLFW C library).
newtype Joystick  
  = Joystick Int
  deriving (Eq, Show)

instance Enum Joystick where
  fromEnum (Joystick i) | i < 0 = 0
  fromEnum (Joystick i) | i < _GLFW_JOYSTICK_LAST = i
  fromEnum _ = _GLFW_JOYSTICK_LAST
  toEnum i | i < _GLFW_JOYSTICK_LAST = Joystick i
  toEnum _ = Joystick _GLFW_JOYSTICK_LAST

