-- | Callback type for 'keyCallback'.
type KeyCallback = Key -> KeyButtonState -> IO ()
-- | Set the callback function that will be called when there is a key event,
--   i.e., everytime the state of a single key is changed. The reported keys
--   are unaffected by any modifiers (such as SHIFT or ALT).
keyCallback :: GL.SettableStateVar KeyCallback
keyCallback = GL.makeSettableStateVar setter
  where 
    setter f = do
      let g k s = f (if k < 256 then CharKey (toEnum k)
                        else SpecialKey (toEnum k)) (toEnum s)
      ptr <- glfwWrapFun2 g
      glfwSetCallbackIORef glfwKeyfun ptr
      glfwSetKeyCallback ptr

